import React from 'react';
import { Link } from 'react-router-dom';
import './Bottonfocus.css';

function Bottonfocus({ svgIcon, fill, text }) {
    return (
        <div>
            <button className="button-focus-container">
                <div className="buttonfocus-content">
                    <div className="icon-container" dangerouslySetInnerHTML={{ __html: svgIcon(fill) }}>
                        {/* SVG is rendered here with dynamic fill */}
                    </div>
                    <div className="buttonfocus-text-container">
                        <p>{text}</p>
                    </div>
                </div>
            </button>
        </div>
    );
}

export default Bottonfocus;
